import { Link } from "react-router-dom";
import styles from "./styles.module.css";
import axios from "axios";
import React, { useState, useEffect } from 'react'


const TopicDetailsRetrieve = () =>{

    const[id,setId] = useState()
    const[groupName,setGROUPNAME] = useState()
    const[topic,setTOPIC] = useState()
    const[year,setYEAR] = useState()
    const[supervisor,setSUPERVISOR] = useState()
    const[coSupervisor,setCOSUPERVISOR] = useState()

    useEffect(() => {

        axios.get("http://localhost:8082/api/topic/getGroupName/" +localStorage.getItem("groupName"))

        .then((response) =>{
            setId(response.data[0]._id)
            setGROUPNAME(response.data[0].groupName)
            setTOPIC(response.data[0].topic)
            setYEAR(response.data[0].year)
            setSUPERVISOR(response.data[0].supervisor)
            setCOSUPERVISOR(response.data[0].coSupervisor)

            console.log(response.data)
        })

        .catch(function(error){

            console.log(error)
        });
    }, []);

    return(

        <div className={styles.topic_container}>
            <div className= {styles.topic_form_container}>
            <div className={styles.colt2}>
                <form className= {styles.form_container}>
                    <h1>Registered topic Details</h1>

                    <input
                            type="text"                       
                            name="id"                            
                            value={id}                           
                            className={styles.input}
                    />
                    <input
                            type="text"                       
                            name="groupName"                            
                            value={groupName}
                            className={styles.input}
                    />
                    <input
                            type="text"                       
                            name="topic"                            
                            value={topic}
                            className={styles.input}
                    />
                    <input
                            type="text"                       
                            name="year"                            
                            value={year}
                            className={styles.input}
                    />
                    <input
                            type="text"                       
                            name="supervisor"                            
                            value={supervisor}
                            className={styles.input}
                    />
                    <input
                            type="text"                       
                            name="coSupervisor"                            
                            value={coSupervisor}
                            className={styles.input}
                    />
                </form>

            </div>

            </div>
                <Link to ="/regtopicupdate">
			    <button type ="button" className={styles.upd_btn}>
				        Update Details
				</button>
				</Link>

                <Link to ="/">
			    <button type ="button" className={styles.lg_btn}>
				        Back to Main
				</button>
				</Link>

        </div>
    );


};

export default TopicDetailsRetrieve;
